import './style.css';

import { NavLink } from 'react-router-dom';

import sun_icon from './../../img/icons/sun.svg';
import moon_icon from './../../img/icons/moon.svg';

const Navbar = () => {

    const activeLinkClass = 'nav-list__link nav-list__link--active';
    const normalLinkClass = 'nav-list__link';

    return (
        <nav className="nav">
            <div className="container">
                <div className="nav-row">
                    <NavLink to='/' className="logo">
                        <strong>Freelancer</strong> portfolio
                    </NavLink>

                    <button className="dark-mode-btn">
                        <img src={sun_icon} alt="Light mode" className="dark-mode-btn__icon" />
                        <img src={moon_icon} alt="Dark mode" className="dark-mode-btn__icon" />
                    </button>

                    <ul className="nav-list">
                        <li className="nav-list__item">
                            <NavLink to='/' className={({isActive}) =>{
                                return isActive ? activeLinkClass : normalLinkClass
                            }}>
                                Home
                            </NavLink>
                        </li>
                        <li className="nav-list__item">
                            <NavLink to='/projects' className={({isActive}) =>{
                                return isActive ? activeLinkClass : normalLinkClass
                            }}>
                                Projects
                            </NavLink>
                        </li>
                        <li className="nav-list__item">
                            <NavLink to='/contacts' className={({isActive}) =>{
                                return isActive ? activeLinkClass : normalLinkClass
                            }}>
                                Contacts
                            </NavLink>
                        </li>
                    </ul>
                </div>
            </div>
        </nav> 
    );
}
 
export default Navbar;
